CREATE DEFINER=`projectadmin`@`localhost` FUNCTION `getPostCount`(userid varchar(255)) RETURNS int
begin
declare count int;
    select count(*) into count from posts where posts.poster_id = UUID_TO_BIN(userid);
return count;
end ;;
